import logo from './logo.svg';
import './App.css';
import {Routs, Route, Link} from "react-router-dom";
import Cont from './Cont';

function App() {
  return (
    <div className="App">

      <Routs>
        <Route path='/' element={<Cont/>}>

        </Route>
      </Routs>
      <header className="App-header">
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><button>Movies</button></li>
          <li><button>TV Series</button></li>
          <li><button>Channels</button></li>
        </ul>
      </header>
    </div>

  );
}

export default App;
